const AvatarUser = (props) => {

    let i;
    for (i = 0; i < props.name.length; i++){
        if (props.name[i] == ' ')
        break;
    }
    let Avtr = props.name[0];
    if (i < props.name.length)
        Avtr += props.name[i + 1];
    return (
        <div>
            <div className={"bg-[" +props.backColor+ "] rounded-full h-[60px] w-[60px]"}>
            {Avtr}
            </div>
        </div>
    );
}

export default AvatarUser;
